// src/components/Box.js

import React from 'react';
import '../App.css'; // Import the styles

function Box({ id, width, height, background }) {
  // Define the background image path
  const backgroundImage = id === 'box1' ? 'img/grill.jpeg' : 'img/grill.jpeg';

  // Define additional styles based on id or background prop
  const boxStyles = {
    backgroundImage: `url(${backgroundImage})`,
    width: width,
    height: height,
    background: background,
    // Add additional styles here...
  };

  return (
    <div className="box" id={id} style={boxStyles}></div>
  );
}

export default Box;
